import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom'; // Import useNavigate
import Navbar from '../../components/Navbar';
import './signup.css';

function Signup() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [userType, setUserType] = useState('');
  const userTypes = ['Retail seller', 'Wholesale user', 'Staff'];
  const navigate = useNavigate(); // Initialize useNavigate

  const handleChange = (event) => {
    setUserType(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault(); // Prevent default form submission

    // Basic validation (you can add more)
    if (!username || !email || !password || !userType) {
      alert("Please fill in all fields.");
      return;
    }

    // Redirect to the Retailer Registration form, passing the data as URL parameters
    navigate(`/rtreg?username=${username}&email=${email}`);
  };

  return (
    <>
      <div>
        <Navbar />
      </div>
      <div className='signup_container'>
        {/* ... (Image Container - unchanged) ... */}
        <div className='signup_box'>
          <div className='signup_form'>
            <div className='text'>Sign Up</div>
            <form onSubmit={handleSubmit}> {/* Wrap the form elements in a <form> tag */}
              <div className='input_elements'>
                <div className='input_items'>
                  <img src='\Images\user_icon.png' alt='User Icon' />
                  <input
                    type='text'
                    placeholder='Username'
                    value={username}
                    onChange={(e) => setUsername(e.target.value)}
                    required // Add the required attribute
                  />
                </div>
                <div className='input_items'>
                  <img src='\Images\email_icon.png' alt='Email Icon' />
                  <input
                    type='email'
                    placeholder='Email'
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    required // Add the required attribute
                  />
                </div>
                <div className='input_items'>
                  <img src='\Images\pwd_icon.png' alt='Password Icon' />
                  <input
                    type='password'
                    placeholder='Password'
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    required // Add the required attribute
                  />
                </div>
                <div className='input_items'>
                  <img src='\Images\user_type.png' alt='User Type Icon' />
                  <input
                    type='text'
                    placeholder='User Type'
                    value={userType}
                    onChange={handleChange}
                    list="user-types"
                    required // Add the required attribute
                  />
                  <datalist id="user-types">
                    {userTypes.map((type, index) => (
                      <option key={index} value={type} />
                    ))}
                  </datalist>
                </div>
              </div>
              <div className='submit-container'>
                <button type="submit" className='submit'>Signup</button> {/* Changed to type="submit" */}
              </div>
            </form>
            <div className='links'>
              <a href='/login'>Already have an account? Login</a>
              <br />
              <a href='/forgot-password'>Forgot Password?</a>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Signup;
